import React, { useEffect, useRef } from 'react';

interface Voto {
  id: number;
  nombre: string;
  prediccion: 'varon' | 'nina';
  comentario?: string;
  foto_url?: string;
  fecha_voto: string;
}

interface TreeVisualizationProps {
  votos: Voto[];
}

const TreeVisualization: React.FC<TreeVisualizationProps> = ({ votos }) => {
  const canvasRef = useRef<HTMLCanvasElement>(null);

  useEffect(() => {
    const canvas = canvasRef.current;
    if (!canvas) return;

    const ctx = canvas.getContext('2d');
    if (!ctx) return;

    // Configurar canvas
    canvas.width = canvas.offsetWidth;
    canvas.height = canvas.offsetHeight;
    const width = canvas.width;
    const height = canvas.height;

    // Limpiar canvas
    ctx.clearRect(0, 0, width, height);

    // Dibujar cielo
    const gradient = ctx.createLinearGradient(0, 0, 0, height);
    gradient.addColorStop(0, '#87CEEB');
    gradient.addColorStop(1, '#98FB98');
    ctx.fillStyle = gradient;
    ctx.fillRect(0, 0, width, height);

    // Dibujar tronco del 치rbol
    ctx.fillStyle = '#8B4513';
    ctx.fillRect(width / 2 - 20, height - 100, 40, 100);

    // Dibujar ramas principales
    ctx.strokeStyle = '#8B4513';
    ctx.lineWidth = 8;
    ctx.beginPath();
    ctx.moveTo(width / 2, height - 120);
    ctx.lineTo(width / 2 - 80, height - 180);
    ctx.moveTo(width / 2, height - 120);
    ctx.lineTo(width / 2 + 80, height - 180);
    ctx.moveTo(width / 2, height - 140);
    ctx.lineTo(width / 2 - 60, height - 200);
    ctx.moveTo(width / 2, height - 140);
    ctx.lineTo(width / 2 + 60, height - 200);
    ctx.stroke();

    // Dibujar hojas seg칰n los votos
    votos.forEach((voto, index) => {
      const leafColor = voto.prediccion === 'varon' ? '#3b82f6' : '#ec4899';

      // Posici칩n de la hoja basada en el 칤ndice
      const angle = (index * 137.5) * (Math.PI / 180); // 츼ngulo dorado
      const radius = 80 + (index * 5);
      const x = width / 2 + Math.cos(angle) * radius;
      const y = height - 200 + Math.sin(angle) * radius;

      // Dibujar hoja
      ctx.fillStyle = leafColor;
      ctx.beginPath();
      ctx.ellipse(x, y, 8, 12, angle, 0, 2 * Math.PI);
      ctx.fill();

      // Agregar brillo
      ctx.fillStyle = 'rgba(255, 255, 255, 0.3)';
      ctx.beginPath();
      ctx.ellipse(x - 2, y - 3, 3, 5, angle, 0, 2 * Math.PI);
      ctx.fill();
    });

    // Dibujar nubes decorativas
    ctx.fillStyle = 'rgba(255, 255, 255, 0.7)';
    ctx.beginPath();
    ctx.arc(width * 0.2, height * 0.1, 30, 0, 2 * Math.PI);
    ctx.arc(width * 0.2 + 25, height * 0.1, 25, 0, 2 * Math.PI);
    ctx.arc(width * 0.2 + 45, height * 0.1, 20, 0, 2 * Math.PI);
    ctx.fill();

    ctx.beginPath();
    ctx.arc(width * 0.8, height * 0.15, 25, 0, 2 * Math.PI);
    ctx.arc(width * 0.8 + 20, height * 0.15, 20, 0, 2 * Math.PI);
    ctx.arc(width * 0.8 + 35, height * 0.15, 15, 0, 2 * Math.PI);
    ctx.fill();

  }, [votos]);

  return (
    <div className="tree-container">
      <canvas
        ref={canvasRef}
        style={{
          width: '100%',
          height: '100%',
          display: 'block'
        }}
      />

      {/* Leyenda */}
      <div style={{
        position: 'absolute',
        bottom: '20px',
        left: '20px',
        background: 'rgba(255, 255, 255, 0.9)',
        padding: '15px',
        borderRadius: '10px',
        boxShadow: '0 4px 15px rgba(0, 0, 0, 0.1)'
      }}>
        <h4 style={{ marginBottom: '10px', fontSize: '1rem' }}>Leyenda:</h4>
        <div style={{ display: 'flex', gap: '15px', alignItems: 'center' }}>
          <div style={{ display: 'flex', alignItems: 'center', gap: '5px' }}>
            <div style={{
              width: '12px',
              height: '18px',
              backgroundColor: '#3b82f6',
              borderRadius: '50%',
              transform: 'rotate(45deg)'
            }}></div>
            <span>游녽 Var칩n</span>
          </div>
          <div style={{ display: 'flex', alignItems: 'center', gap: '5px' }}>
            <div style={{
              width: '12px',
              height: '18px',
              backgroundColor: '#ec4899',
              borderRadius: '50%',
              transform: 'rotate(45deg)'
            }}></div>
            <span>游녾 Ni침a</span>
          </div>
        </div>
      </div>

      {/* Contador de hojas */}
      <div style={{
        position: 'absolute',
        top: '20px',
        right: '20px',
        background: 'rgba(255, 255, 255, 0.9)',
        padding: '15px',
        borderRadius: '10px',
        boxShadow: '0 4px 15px rgba(0, 0, 0, 0.1)',
        textAlign: 'center'
      }}>
        <div style={{ fontSize: '1.5rem', fontWeight: 'bold', color: '#667eea' }}>
          {votos.length}
        </div>
        <div style={{ fontSize: '0.9rem', color: '#666' }}>
          Hojas en el 치rbol
        </div>
      </div>
    </div>
  );
};

export default TreeVisualization;
